import React from "react";
import Row from "./Row";

function Table({rows}) {
    return <table className="table table-striped table-bordered table-hover">
        <thead className="text-center">
            <tr>
                <th className="col-1">IP</th>
                <th className="col-1">Duration</th>
                <th className="col-1">Time attempt</th>
            </tr>
        </thead>
        <tbody className="text-center table-group-divider">
            {rows.map((row, ind) => (
                <Row key={index}/>
            )) }
        </tbody>
    </table>
}

export default Table;
